function send(){$.post("./thirdpartyapi/paymentgateway",JSON.stringify({amount:$("#price").val(),name:$("#username").val(),email:$("#email").val(),phonenum:$("#phone").val()}),e=>{alertify.warning("You'll be redirected to pay at our merchant partner"),location.href="https://dev.toyyibpay.com/"+JSON.parse(e)[0].BillCode})}key=JSON.parse(sessionStorage.user).userid,$.post("./api/read/spesific/beneficiaries",JSON.stringify({key:key}),e=>{if(console.log(e),"error"===e.Status)return console.log(e),void alertify.error(e.error);alldata=e.Return,$("#username").val(alldata.username),$("#email").val(alldata.useremail),$("#phone").val(alldata.userphone),$("#price").val(236.23)});